// Fun√ß√£o para extrair valores num√©ricos com seguran√ßa
const safeNumber = (value) => {
  if (value === null || value === undefined || value === '') return 0;
  const num = Number(value);
  return isNaN(num) ? 0 : num;
};

// Fun√ß√£o para calcular estat√≠sticas b√°sicas
const calculateStats = (values) => {
  const numbers = values.map(v => safeNumber(v)).filter(v => v > 0);

  if (numbers.length === 0) {
    return { mean: 0, stdDev: 0, median: 0, min: 0, max: 0 };
  }

  const sum = numbers.reduce((a, b) => a + b, 0);
  const mean = sum / numbers.length;

  const squaredDiffs = numbers.map(v => Math.pow(v - mean, 2));
  const variance = squaredDiffs.reduce((a, b) => a + b, 0) / numbers.length;
  const stdDev = Math.sqrt(variance);

  const sorted = [...numbers].sort((a, b) => a - b);
  const median = sorted.length % 2 === 0
    ? (sorted[sorted.length / 2 - 1] + sorted[sorted.length / 2]) / 2
    : sorted[Math.floor(sorted.length / 2)];

  return { 
    mean: Math.round(mean), 
    stdDev: Math.round(stdDev), 
    median: Math.round(median), 
    min: Math.min(...numbers), 
    max: Math.max(...numbers) 
  };
};

// Fun√ß√£o para detectar outliers usando Z-Score
const detectOutliers = (values, threshold = 1.5) => {
  const numbers = values.map(v => safeNumber(v));
  const { mean, stdDev } = calculateStats(values);

  if (stdDev === 0) {
    return numbers.map((value, index) => ({
      index,
      value,
      zScore: 0,
      isOutlier: false,
      outlierType: 'normal',
      deviationFromMean: 0
    }));
  }

  return numbers.map((value, index) => {
    const zScore = (value - mean) / stdDev;
    const isOutlier = Math.abs(zScore) > threshold; // threshold flex√≠vel
    const outlierType = zScore > threshold ? 'positive' : (zScore < -threshold ? 'negative' : 'normal');

    return {
      index,
      value,
      zScore: Math.round(zScore * 100) / 100,
      isOutlier,
      outlierType,
      deviationFromMean: Math.round(value - mean)
    };
  });
};

// Fun√ß√£o para normaliza√ß√£o Min-Max
const normalizeMinMax = (values) => {
  const numbers = values.map(v => safeNumber(v));
  const positiveNumbers = numbers.filter(v => v > 0);

  if (positiveNumbers.length === 0) {
    return numbers.map(() => 0);
  }

  const min = Math.min(...positiveNumbers);
  const max = Math.max(...positiveNumbers);
  const range = max - min;

  if (range === 0) return numbers.map(v => v > 0 ? 1 : 0);

  return numbers.map(v => v === 0 ? 0 : (v - min) / range);
};

