const hasRealNumbers = (justificativa) => {
  if (!justificativa) return false;

  // Normalizar string removendo escapes e convertendo para lowercase
  const normalizedText = String(justificativa)
    .replace(/\\"/g, '"')
    .replace(/\\\\/g, '\\')
    .toLowerCase();

  const patterns = [
    /z-?score\s*[:\s=]?\s*[-+]?\d+\.?\d*/i,
    /engagement\s*[:\s=]?\s*\d+/i,
    /score\s*[:\s=]?\s*\d+/i,
    /\d+\.?\d*\s*z-?score/i,
    /views?\s*[:\s=]?\s*\d+/i,
    /\d+\s*(views?|curtidas|coment√°rios)/i,
    /\d+M\+?\s*(views?|visualiza√ß√µes)/i,
    /likes\s*z-?score\s*[:\s=]?\s*[-+]?\d+\.?\d*/i,
    /comments\s*z-?score\s*[:\s=]?\s*[-+]?\d+\.?\d*/i,
    /engajamento\s*(de|m√°ximo)?\s*\d+/i,
    /\bde\s+\d+/i,
    /com\s+\d+/i,
    /[-+]?\d+\.?\d+/
  ];

  return patterns.some(pattern => pattern.test(normalizedText));
};

